(window.webpackJsonp=window.webpackJsonp||[]).push([[902],{1256:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1787-phong-diep-lang"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1787-phong-diep-lang"}},[n._v("#")]),n._v(" Chương 1787: Phong Diệp Lang")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Phong Diệp Lang【 Canh [3]】"),t("br"),t("br"),n._v("“Các ngươi?”"),t("br"),t("br"),n._v("Ngô Khoáng nhíu nhíu mày."),t("br"),t("br"),n._v("Mặc dù hiện tại Địa quật, không còn Dị Linh tộc nhân quân đội, nhưng vẫn là có không ít Dị Linh tộc nhân sống sót trong đó, đã tên là thám hiểm, khẳng định sẽ có nguy hiểm, đồng đội quá yếu, đối thực lực tổng hợp, đồng dạng có rất lớn ảnh hưởng."),t("br"),t("br"),n._v("Trước mắt hai vị này, đồng tử không cần phải nói, khuôn mặt trắng bệch, vừa nhìn liền biết bị trọng thương, thanh niên cũng ốm yếu, nhìn thực lực, liền Thánh vực đều không có đạt tới, hai người này mang theo, tuyệt đối là vướng víu."),t("br"),t("br"),n._v("“Không biết các ngươi loại tình huống này vì sao muốn vào Địa quật, chẳng qua, ta vẫn là khuyên bảo một câu, tốt nhất đừng cầm tính mạng nói đùa!”"),t("br"),t("br"),n._v("Dừng lại một chút, Ngô Khoáng khuyên can nói."),t("br"),t("br"),n._v("“Ngô sư ý tốt, tâm lĩnh, nhưng mà ta hai người có phải đi Địa quật mục đích, chúng ta chỉ đi theo các ngươi sau lưng đi vào liền có thể, còn nguy hiểm, bản thân gánh chịu, chắc chắn sẽ không liên lụy chư vị!”"),t("br"),t("br"),n._v("Cười khổ một tiếng, Trương Huyền nói."),t("br"),t("br"),n._v("Đường đường nhân tộc đệ nhất thiên tài, Kim Thân cảnh đại viên mãn cường giả, lại bị một cái Thánh vực tứ trọng gia hỏa rất khinh bỉ... Suy nghĩ một chút đều cảm thấy tâm tắc."),t("br"),t("br"),n._v("“Vậy là tốt rồi!”"),t("br"),t("br"),n._v("Ngô Khoáng nếu không nói."),t("br"),t("br"),n._v("Sống chết có bản thân quyết định, lời nói mới nói, đối phương còn muốn kiên trì, thật nếu gặp phải nguy hiểm, cũng không thể trách nhóm người mình khoanh tay đứng nhìn."),t("br"),t("br"),n._v("Dù sao, ai cũng không cứu được người nghĩa vụ."),t("br"),t("br"),n._v("“Không biết sống chết...”"),t("br"),t("br"),n._v("“Khẳng định là chưa ăn qua thiệt thòi, không biết cái gì là nguy hiểm!”"),t("br"),t("br"),n._v("Những người khác, gặp hai cái này như vậy đều muốn quá khứ, tất cả đều lộ ra khinh thường."),t("br"),t("br"),n._v("Thực lực liền Thánh vực đều không có, phi hành đều không làm được, thật gặp được nguy hiểm, chạy trốn năng lực đều không có, không phải tự tìm cái chết là cái gì?"),t("br"),t("br"),n._v("Không nói thêm lời, đám người đi ra cũ nát gác chuông, hướng về phía trước kiến trúc đi đến, mới đi mấy bước, mấy vị chiến sư xuất hiện, ngăn lại đường đi."),t("br"),t("br"),n._v("“Thất tinh danh sư, Ngô Khoáng, đây là ta thông hành văn kiện!” Ngô Khoáng đi tới trước mặt."),t("br"),t("br"),n._v("Một vị chiến sư nhận lấy thông hành văn kiện, cẩn thận kiểm tra một phen, lúc này mới gật gật đầu: “Đi vào đi, chỉ có ba ngày thời gian, ba ngày nhất định phải trở về!”"),t("br"),t("br"),n._v("“Yên tâm!”"),t("br"),t("br"),n._v("Cười cười, Ngô Khoáng mang theo đám người, đi vào."),t("br"),t("br"),n._v("Tuy là Địa quật mở ra, để bình thường danh sư cùng tu luyện giả đi vào, còn là cần sớm chuẩn bị thông hành văn kiện, nếu không, tu vi liền Thánh vực đều không có đi đến, liền tiến vào trong đó, sẽ khó mà khống chế."),t("br"),t("br"),n._v("Địa quật lối vào liền phong ấn tại trong kiến trúc, đám người đi một hồi, thuận lợi đi vào."),t("br"),t("br"),n._v("Cùng trước đó đồng dạng, Huyết Nguyệt treo trên cao, toàn bộ thế giới, tràn đầy sát lục chi khí."),t("br"),t("br"),n._v("“Chư vị lần đầu tiên đi vào nơi này, cần điều chỉnh một đoạn thời gian, nếu không, rất dễ dàng bị giết chóc chi khí xâm nhập tinh thần, hình thành tâm ma!”"),t("br"),t("br"),n._v("Đi tới một chỗ chỗ trống, Ngô Khoáng cũng không tiếp tục đi tới, mà là bàn giao nói."),t("br"),t("br"),n._v("Sát lục chi khí mười phần đáng sợ, tâm cảnh không đủ tu luyện giả, rất dễ dàng bị xâm nhập, tạo thành không thể khôi phục tâm lý thương tích."),t("br"),t("br"),n._v("Những người này lần đầu tiên đi vào, coi như tu vi không kém, cũng cần điều chỉnh một đoạn thời gian, mới có thể tiếp tục đi sâu."),t("br"),t("br"),n._v("“Chúng ta...”"),t("br"),t("br"),n._v("Thấy mọi người muốn nghỉ ngơi tại chỗ, Ngột Thần nhìn qua."),t("br"),t("br"),n._v("Bọn họ tuy là bị thương bị thương, tu vi không có khôi phục, không có khôi phục, có thể loại trình độ này sát lục chi khí, không đáng kể chút nào, không cần thiết bồi tiếp mọi người tại nơi này chậm trễ thời gian."),t("br"),t("br"),n._v("“Đừng có gấp, ngươi ta hiện tại trạng thái, coi như lo lắng trở về, cũng không có biện pháp gì, không bằng, vừa đi vừa khôi phục thực lực, chí ít nơi này coi như an toàn!” Trương Huyền nói."),t("br"),t("br"),n._v("Vị này Thần Dung Hoàng từ nhỏ liền sinh tồn ở Huyết Nguyệt hoàn cảnh bên trong, ở đây khôi phục so danh sư đại lục thực sự nhanh hơn nhiều."),t("br"),t("br"),n._v("Ngột Thần gật gật đầu."),t("br"),t("br"),n._v("Loại trạng thái này, lo lắng xông tới, làm không cẩn thận sẽ còn rơi vào đối phương cạm bẫy, dứt khoát đối phương ở ngoài sáng, hắn ở trong tối, còn không bằng đi được tới đâu hay tới đó."),t("br"),t("br"),n._v("Đám người không nói chuyện, riêng phần mình thích ứng sát lục chi khí, Trương Huyền thì tinh thần đi vào không gian gấp, đem bên trong dự trữ bảo vật linh khí, điều lấy ra, lặng lẽ rót vào huyệt đạo, chui vào trong cơ thể, rèn luyện suốt ngày đạo chân tức giận."),t("br"),t("br"),n._v("Tích huyết trùng sinh, là có thể người bảo lãnh sẽ không chết, nhưng chém giết một lần, liền sẽ tiêu hao rất lớn tuổi thọ, nguyên nhân chính là như vậy, Trương Hoằng Thiên thực lực mặc dù cực mạnh, đồng dạng trước tại những người khác vẫn lạc."),t("br"),t("br"),n._v("Trương Huyền đoạn tuyệt tại Danh Sư đường, thứ nhất đối nhân tộc có cái bàn giao, thứ hai, cũng có thể thần không biết quỷ không hay đi vào Dị Linh tộc, không đến mức bị phát hiện, càng thêm tuỳ cơ ứng biến."),t("br"),n._v(" Cô cô cô!"),t("br"),t("br"),n._v("Linh khí điên cuồng tràn vào trong cơ thể, kèm theo chân khí càng ngày càng mạnh mẽ, thực lực cũng khôi phục nhanh chóng."),t("br"),t("br"),n._v("Rất nhanh tới đến Thánh vực cảnh giới, tiếp lấy một tầng, nhị trọng..."),t("br"),t("br"),n._v("Không đến nửa canh giờ, liền khôi phục được ba tầng trái phải."),t("br"),t("br"),n._v("Sa sa sa!"),t("br"),t("br"),n._v("Đang cố gắng khôi phục, liên tiếp thanh âm vang vọng bên tai bên trong, Trương Huyền ngay sau đó mở mắt, hướng nơi xa nhìn lại."),t("br"),t("br"),n._v("Ngột Thần cũng mày nhăn lại."),t("br"),t("br"),n._v("“Là cái gì?”"),t("br"),t("br"),n._v("Đối với Dị Linh tộc hoàn cảnh, Trương Huyền hiểu rõ không nhiều, đành phải truyền âm hỏi thăm."),t("br"),t("br"),n._v("“Là Phong Diệp Lang, dựa vào thôn phệ Huyết Nguyệt lực lượng mà mạnh lên, Lang Vương nắm giữ Thánh vực ngũ trọng Xuất Khiếu cảnh thực lực, mười phần hung tàn!”"),t("br"),t("br"),n._v("Ngột Thần nói."),t("br"),t("br"),n._v("“Phong Diệp Lang?”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("Dị Linh tộc vị trí cổ chiến trường, tuy là hoàn cảnh tồi tệ, nhưng cũng có vô số linh thú cùng cây cối, cái này cái gọi là Phong Diệp Lang, chưa từng nghe qua, nhưng có thể để cho đường đường Thần Dung Hoàng nói hung tàn, cũng không đơn giản."),t("br"),t("br"),n._v("“Mọi người cẩn thận, hình như có đồ vật gì đó tới...”"),t("br"),t("br"),n._v("Bên này truyền âm, bên kia Ngô Khoáng, dường như cũng phát hiện, một tiếng kinh hô, vội vàng đứng lên."),t("br"),t("br"),n._v("Rầm!"),t("br"),t("br"),n._v("Tiếng nói mới vừa kết thúc, chỉ thấy bảy, tám đầu lang, đã phong tỏa bốn phía, đem mọi người vây quanh ở trong đó."),t("br"),t("br"),n._v("Những này lang, toàn thân màu xám, chỉ có trên trán, một túm bạch mao, như là lá phong."),t("br"),t("br"),n._v("Số lượng không nhiều, lại từng cái mang theo hung mãnh khí tức, để đám người tất cả đều sợ tới mức vẻ mặt trắng bệch."),t("br"),t("br"),n._v("“Không cần chống cự, ngoan ngoãn làm lương thực của chúng ta... Có thể cho các ngươi một cái thoải mái!”"),t("br"),t("br"),n._v("Quát lạnh một tiếng, ngay sau đó đàn sói đằng sau, một đầu toàn thân trắng như tuyết Lang Vương đi ra, hai mắt ửng hồng."),t("br"),t("br"),n._v("“Xuất Khiếu cảnh thực lực?”"),t("br"),t("br"),n._v("Đồng tử co rụt lại, Ngô Khoáng thân thể cứng ngắc."),t("br"),t("br"),n._v("Những người khác cũng từng cái vẻ mặt trắng bệch."),t("br"),t("br"),n._v("Không nghĩ tới vận khí đen đủi như vậy."),t("br"),t("br"),n._v("Vốn nghĩ, đi vào nơi này, tìm tới thích hợp dược liệu bảo vật, liền xoay người rời đi, kiếm một món hời, nằm mơ cũng không ngờ tới, vừa mới đi vào, liên sát lục chi khí đều không có thích ứng, liền gặp cường đại như vậy Thánh thú!"),t("br"),t("br"),n._v("Sát lục chi khí hun đúc ở dưới Phong Diệp Lang, bản thân liền so cùng cấp bậc danh sư càng thêm hung tàn, hiện tại lại xuất hiện Lang Vương..."),t("br"),t("br"),n._v("Chẳng lẽ, vừa mới đi tới, liền muốn chết ở đây?"),t("br"),t("br"),n._v("“Chuẩn bị kỹ càng ác chiến...”"),t("br"),t("br"),n._v("Hít sâu một hơi, híp mắt lại, Ngô Khoáng cổ tay khẽ đảo, một thanh trường kiếm xuất hiện tại lòng bàn tay, đột nhiên nâng lên, đi đầu hướng Lang Vương đâm tới."),t("br"),t("br"),n._v("Hiện tại sống sót duy nhất cơ hội, chính là nghĩ biện pháp đem hắn đánh giết, cái tên này chết một lần, cái khác Phong Diệp Lang cũng liền không đáng sợ."),t("br"),t("br"),n._v("“Ngao ô!”"),t("br"),t("br"),n._v("Gặp cái này nhân loại, vừa ra tay liền đối đầu bản thân, Lang Vương cười lạnh, ánh mắt lộ ra nồng đậm vẻ khinh miệt, móng vuốt nâng lên hướng về phía trước vỗ một cái."),t("br"),t("br"),n._v("Rầm!"),t("br"),t("br"),n._v("Sát lục chi khí tuôn ra, một đạo hung mãnh mùi máu tanh quét sạch, Ngô Khoáng còn không có phản ứng lại, liền bay ngược ra ngoài, trùng trùng điệp điệp ngã xuống đất."),t("br"),t("br"),n._v("Thất tinh đỉnh phong danh sư, vậy mà không phải địch!"),t("br"),t("br"),n._v("(Tấu chương xong)."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1798"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1800"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);